import React from 'react'
import{useEffect,useState} from 'react'
import { Row,Col, Container} from 'react-bootstrap'
import Workoutform from '../components/Workoutform'
import Fetchworkout from '../components/Fetchworkout'
import{useDispatch} from 'react-redux'


function Home(){
  const[workout,setWorkout]= useState()

  // const fetchWorkout = async() =>  {
  //   const response = await fetch('http://localhost:4000/api/workout')
  //   const jsondata =  await response.json()
  //   setWorkout(jsondata)
  //   }

  // useEffect(()=>{fetchWorkout()},[])

  const dispatch = useDispatch();

  const fetchProduct = async()=> {
    const response = await fetch('http://localhost:4000/api/workout');
    const jsonData = await response.json();
    dispatch(setWorkout(jsonData));         
    }

    useEffect(() => {fetchProduct()},[]);

  return (
    <>
    <Container>
    <Row className='m-5'>
    <Col>
    { workout && workout.slice().reverse().map((item=>(
      <Fetchworkout workout={workout} id= {item._id} item={item} title={item.title} reps={item.reps} load={item.load} date={item.createdAt} setWorkout= {setWorkout}/>
      )))}


    </Col>

    <Col>
    <Workoutform/>
    </Col>
    </Row>
    </Container>
    </>
  )
}
export default Home
